// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "@openzeppelin/contracts/access/Ownable.sol";
import "erc721a/contracts/ERC721A.sol";

interface ICanvas {
    function getMessageSender() external view returns (address);
}

contract UintsProofOfBroadcast is ERC721A, Ownable {

    address _editionContract;

    constructor() ERC721A("UINTS PROOF OF BROADCAST", "POB") {}

    function setEditionContract(address contractAddress) public onlyOwner {
        _editionContract = contractAddress;
    }

    address _canvasAddress = 0x43D218197E8c5FBC0527769821503660861c7045;
    ICanvas _canvasContract = ICanvas(_canvasAddress);

    function getMessageSender() external view returns (address) {
        return msg.sender;
    }

    function getCanvasMessageSender() external view returns (address) {
        return _canvasContract.getMessageSender();
    }

}

